    const model="RoyalEnfleid";
    const { bikeinfo,maintain,color }=props;//destructuring
    const {rate,warenty}=bikeinfo;//det
    const text=`I Am A ${color} ${model} ${maintain},Bike_Rate:${rate} & Bike_Warenty:${warenty}`; 
    return (
          <h2>{text}</h2>
        );
    }
export default bike;
